import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './assets/components/Header';

function App() {
  return (
    <>
      <Header />
      <section className='container-fluid' id='history'>
        <div className='container'>
          <div className='row'>
            <div className='col-12 col-md-6'></div>
          </div>
        </div>
      </section>
    </>
  );
}

export default App;
